    return "<div class=\"new-agenda-list-container loading{{#if hasTopBar}} has-top-bar{{/if}}{{#if showAddEntry}} has-add-entry{{/if}}\">\n  <!-- Filter Overlay -->\n  {{#if filtersInOverlay}}\n  <div class=\"new-agenda-search-filter-overlay\">\n    <div class=\"agenda-overlay-screen\"></div>\n    <div class=\"agenda-overlay-wrapper\">\n      <div class=\"agenda-overlay-header\">\n        <div class=\"agenda-overlay-close focus-outline\" tabindex=\"0\">\n          <i class=\"fa fa-angle-left\"></i>\n        </div>\n        <div class=\"filter-header-holder\">\n          <div class=\"filter-header-btn-controls\">\n            <div class=\"btn clear-filters hidden focus-outline\" tabindex=\"0\">{{ T \"widgets.list.dynamic.filter.clear\" }}</div>\n            <div class=\"btn apply-filters focus-outline\" tabindex=\"0\">{{ T \"widgets.list.dynamic.filter.apply\" }}</div>\n          </div>\n        </div>\n      </div>\n      <div class=\"agenda-overlay-content\">\n        <div class=\"hidden-filter-controls\">\n          <div class=\"hidden-filter-controls-content\">\n            <div class=\"filters-header\">{{ T \"widgets.list.dynamic.filter.filterBy\" }}</div>\n            <div class=\"filter-holder\">\n              <!-- Filters here -->\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  {{/if}}\n  <!-- End of Filter Overlay -->\n\n  <!-- Top bar with profile and search icons -->\n  <div class=\"section-top-wrapper\">\n    {{#if searchEnabled}}\n    <div class=\"search-holder\">\n      <i class=\"fa fa-search\"></i>\n      <input type=\"search\" name=\"search-feed\" class=\"form-control search-feed focus-outline\" tabindex=\"0\" placeholder=\"{{ T \"widgets.list.dynamic.search.placeholder\"}}\" required >\n      <div class=\"btn btn-default search-btn\">{{ T \"widgets.list.dynamic.search.action\"}}</div>\n      <div class=\"btn btn-default search-btn searching-btn\"><i class=\"fa fa-spinner fa-pulse fa-fw\"></i></div>\n    </div>\n    {{/if}}\n    {{#ifCond filtersEnabled '||' bookmarksEnabled}}\n    <div class=\"list-search-icon\">\n      {{#ifCond bookmarksEnabled '&&' hasTopBar}}\n      <div class=\"toggle-bookmarks focus-outline\" tabindex=\"0\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\" >\n        <span class=\"fa fa-bookmark-o\"></span>\n        <span class=\"fa fa-bookmark\"></span>\n      </div>\n      {{/ifCond}}\n      <div class=\"list-search-cancel focus-outline\" tabindex=\"0\" ><span class=\"fa fa-times\"></span></div>\n      {{#if filtersEnabled}}\n      <i class=\"fa fa-sliders focus-outline\" tabindex=\"0\"></i>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n  </div>\n  <!-- End of Top bar -->\n\n  {{#if bookmarksEnabled}}\n    {{#unless hasTopBar}}\n    <div class=\"agenda-list-controls focus-outline\" tabindex=\"1\">\n      <div class=\"toggle-agenda\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\">\n        <span class=\"fa fa-bookmark-o\"></span>\n        <span class=\"fa fa-bookmark\"></span>\n        <div class=\"agenda-list-label\">{{ T \"widgets.list.dynamic.agenda.list.listLabel\"}}</div>\n      </div>\n    </div>\n    {{/unless}}\n  {{/if}}\n\n  <!-- Days slider -->\n  <div class=\"agenda-date-selector\">\n    <ul>\n      <!-- Day filter will be added here -->\n    </ul>\n  </div>\n\n  <!-- Agenda Cards -->\n  <div class=\"agenda-cards-wrapper\" id=\"agenda-cards-wrapper-{{id}}\">\n    <div class=\"agenda-list-holder\" role=\"list\">\n      <!-- Cards will be rendered here -->\n    </div>\n    <!-- States messages -->\n    <div class=\"agenda-state-messages\">\n      <div class=\"loading-holder\">\n        <i class=\"fa fa-circle-o-notch fa-spin\"></i>{{ T \"widgets.list.dynamic.agenda.loading\" }}\n      </div>\n      <div class=\"no-results-holder\">\n        No matches found\n      </div>\n    </div>\n  </div>\n\n  <!-- Search results -->\n  <div class=\"search-results-wrapper\">\n    <!-- Inline Search and Filters -->\n    <div class=\"hidden-controls\">\n      {{#if searchEnabled}}\n      <div class=\"hidden-search-controls\">\n        <div class=\"hidden-search-controls-content\">\n          <div class=\"hidden-filter-controls-search\">\n            <div class=\"search-query-holder\">\n              <div class=\"search-query\">\n                {{ T \"widgets.list.dynamic.search.searchQuery\"}}\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n      {{/if}}\n      <div class=\"active-filters hidden\">\n        <div class=\"hidden-filter-controls-label\">{{ T \"widgets.list.dynamic.filter.applied\"}}</div>\n        <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\n          <div class=\"hidden-filter-controls-filter-wrapper\">\n            <fieldset data-filter-active-group>\n            </fieldset>\n          </div>\n        </div>\n      </div>\n      {{#if filtersEnabled}}\n      <div class=\"hidden-filter-controls\">\n        <div class=\"hidden-filter-controls-content\">\n          {{#unless filtersInOverlay}}\n            {{#if filtersEnabled}}\n            <div class=\"filter-holder inline-filter-holder\">\n              <!-- Filters here -->\n            </div>\n            {{/if}}\n          {{/unless}}\n        </div>\n      </div>\n      {{/if}}\n    </div>\n    <!-- End of Inline Search and Filters -->\n    <div class=\"search-results-holder\">\n      <div class=\"no-results-holder\">\n        No matches found\n      </div>\n    </div>\n  </div>\n</div>\n\n<!-- Detail view overlay -->\n<div class=\"agenda-detail-overlay\" id=\"agenda-detail-overlay-{{id}}\">\n  <div class=\"agenda-detail-overlay-wrapper\">\n    <div class=\"agenda-detail-overlay-panel\">\n      <div class=\"agenda-detail-overlay-close focus-outline {{#if previousScreen}}go-previous-screen{{/if}}\" tabindex=\"0\">\n        <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\n      </div>\n      <div class=\"agenda-detail-overlay-content\">\n        <div class=\"agenda-detail-overlay-content-holder\">\n          <!-- Details will be added here -->\n        </div>\n      </div>\n    </div>\n    <div class=\"agenda-detail-overlay-close tablet {{#if previousScreen}}go-previous-screen{{/if}}\" >\n      <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\n    </div>\n  </div>\n  <div class=\"agenda-detail-overlay-screen {{#if previousScreen}}go-previous-screen{{/if}}\"></div>\n</div>\n\n{{#if showAddEntry}}\n<div class=\"dynamic-list-add-item focus-outline\" tabindex=\"1\">\n  <i class=\"fa fa-plus\"></i>\n</div>\n{{/if}}\n";
