this["Fliplet"]["Widget"]["Templates"]["templates.build.agenda-cards-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"agenda-item-inner-content clearfix\" data-entry-id=\"{{id}}\">\n  <div class=\"agenda-item-content-holder\">\n    {{#if [Title]}}\n    <h2 class=\"agenda-item-title\">{{[Title]}}</h2>\n    {{/if}}\n    <div class=\"agenda-item-session-location\">\n      {{#if [Location]}}\n      <p class=\"agenda-item-location\">{{{[Location]}}}</p>\n      {{/if}}\n      <p class=\"agenda-item-start-date-time\">{{[Start Time]}}{{#ifCond [Start Time] '&&' [End\n        Time]}} -\n        {{/ifCond}}{{[End Time]}}{{#if [Full Date]}} /\n        {{/if}}{{formatDate [Full Date]}}</p>\n    </div>\n\n    <div class=\"agenda-item-bookmark {{#if agendaButtonsEnabled}}more-buttons{{/if}}\">\n      <div class=\"agenda-item-bookmark-holder agenda-item-bookmark-holder-{{id}}\">\n        <div class=\"bookmark-wrapper focus-outline btn-bookmark\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark-o\"></i>{{ T \"widgets.list.dynamic.detail.bookmark\"}}\n        </div>\n        <div class=\"bookmark-wrapper focus-outline btn-bookmarked\" tabindex=\"0\">\n          <i class=\"fa fa-bookmark\"></i>{{ T \"widgets.list.dynamic.detail.bookmarked\"}}\n        </div>\n\n        <div class=\"agenda-item-add-agenda\"></div>\n      </div>\n      {{#if pollButton}}\n      <div class=\"go-to-poll session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-pie-chart\"></i>{{ T \"widgets.list.dynamic.detail.poll\"}}\n      </div>\n      {{/if}}\n      {{#if surveyButton}}\n      <div class=\"go-to-survey session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-pencil-square-o\"></i>{{ T \"widgets.list.dynamic.detail.survey\"}}\n      </div>\n      {{/if}}\n      {{#if questionsButton}}\n      <div class=\"go-to-questions session-button focus-outline\" tabindex=\"0\">\n        <i class=\"fa fa-question-circle-o\"></i>{{ T \"widgets.list.dynamic.detail.questions\"}}\n      </div>\n      {{/if}}\n    </div>\n\n    <div class=\"agenda-item-description\">\n      {{#each entryDetails}}\n      <!-- Image template -->\n      {{#ifCond type '==' 'image'}}\n      {{#if content}}\n      <div data-detail-entry-id=\"{{id}}\">\n        {{#if labelEnabled}}\n        <div class=\"agenda-item-detail-label\">{{label}}</div>\n        {{/if}}\n        {{#if (isSingle contentArray)}}\n        <div class=\"agenda-item-detail-body-text single-image-holder\">\n          <img src=\"{{validateImage content}}\" />\n        </div>\n        {{else}}\n        <div class=\"multiple-images-holder\">\n          {{#each contentArray}}\n          <div class=\"multiple-images-item\">\n            <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\n          </div>\n          {{/each}}\n        </div>\n        {{/if}}\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Plain text template -->\n      {{#ifCond type '==' 'text'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">{{content}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- HTML template -->\n      {{#ifCond type '==' 'html'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">{{{auth content}}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- URL template -->\n      {{#ifCond type '==' 'url'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">\n        <a href=\"{{{auth content}}}\" target=\"_blank\">{{ T \"widgets.list.dynamic.detail.linkText\"}}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Telephone template -->\n      {{#ifCond type '==' 'tel'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">\n        <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Email template -->\n      {{#ifCond type '==' 'mail'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">\n        <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Number template -->\n      {{#ifCond type '==' 'number'}}\n      {{#if content includeZero=true}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">{{TN content forceNumber=false}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Date template -->\n      {{#ifCond type '==' 'date'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"agenda-item-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"agenda-item-detail-body-text\">{{formatDate content}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- File template -->\n      {{#ifCond type '==' 'file'}}\n      {{#if content}}\n      <ul class=\"file-holder\">\n        {{#if labelEnabled}}\n        <div class=\"agenda-item-detail-label\">{{label}}</div>\n        {{/if}}\n        {{#each content}}\n        <li class=\"file-item\">\n          <div class=\"file-title\">{{this.name}}</div>\n          <div class=\"file-info\">\n            <span class=\"file-info-uploaded\">{{ T \"widgets.list.dynamic.detail.uploaded\"}}:\n              {{formatDate this.uploaded}}</span>\n            {{#if this.size}}<span class=\"file-info-size\">&ndash;\n              {{humanFileSize this.size}}</span>{{/if}}\n          </div>\n          <input type=\"hidden\" value=\"{{this.url}}\" />\n          <div class=\"file-icon\">\n            <i class=\"fa fa-angle-right\"></i>\n          </div>\n        </li>\n        {{/each}}\n      </ul>\n      {{/if}}\n      {{/ifCond}}\n\n      {{/each}}\n    </div>\n\n    {{#ifCond editEntry '||' deleteEntry}}\n    <div class=\"dynamic-list-controls\">\n      {{#if editEntry}}\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">{{T\n        \"widgets.list.dynamic.detail.edit\" }}</div>\n      {{/if}}\n      {{#if deleteEntry}}\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">{{T\n        \"widgets.list.dynamic.detail.delete\" }}</div>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n  </div>\n</div>\n";
},"useData":true});

