"\n        class=\"form-control search-feed focus-outline\"\n        tabindex=\"0\"\n        placeholder=\"{{ T 'widgets.list.dynamic.search.placeholder'}}\"\n        required\n      />\n      <div class=\"btn btn-default search-btn\">{{ T \"widgets.list.dynamic.search.action\"}}</div>\n      <div class=\"btn btn-default search-btn searching-btn\"><i\n          class=\"fa fa-spinner fa-pulse fa-fw\"\n        ></i></div>\n    </div>\n    {{/if}}\n    <div class=\"list-search-icon\">\n      {{#if bookmarksEnabled}}\n      <div\n        class=\"toggle-bookmarks focus-outline\"\n        tabindex=\"0\"\n        data-mixitup-control=\"{{id}}\"\n        data-toggle=\".bookmarked\"\n      >\n        <span class=\"fa fa-bookmark-o\"></span>\n        <span class=\"fa fa-bookmark\"></span>\n      </div>\n      {{/if}}\n      <div class=\"list-search-cancel focus-outline\" tabindex=\"0\">\n        <span class=\"fa fa-times\"></span>\n      </div>\n      {{#if filtersEnabled}}\n      <i class=\"fa fa-sliders focus-outline\" tabindex=\"0\"></i>\n      {{/if}}\n      {{#if sortEnabled}}\n      <div class=\"sort-group btn-group\">\n        <i\n          class=\"fa fa-sort-amount-desc focus-outline\"\n          tabindex=\"0\"\n          data-toggle=\"dropdown\"\n          aria-haspopup=\"true\"\n          aria-expanded=\"false\"\n          aria-hidden=\"true\"\n        ></i>\n        <ul class=\"dropdown-menu list-sort\">\n          {{#each sortFields}}\n          <li data-sort-order=\"none\" data-sort-field=\"{{ this }}\"><span>{{ this }}\n              {{#if this}}<i\n                class=\"fa fa-sort focus-outline\"\n                tabindex=\"0\"\n                aria-hidden=\"true\"\n              ></i><i class=\"fa fa-sort-asc focus-outline\" tabindex=\"0\" aria-hidden=\"true\"></i><i\n                class=\"fa fa-sort-desc focus-outline\"\n                tabindex=\"0\"\n                aria-hidden=\"true\"\n              ></i>{{/if}}</span></li>\n          {{/each}}\n        </ul>\n      </div>\n      {{/if}}\n    </div>\n  </div>\n  <!-- End of Top bar -->\n\n  <!-- Inline Search and Filters -->\n  {{#if searchEnabled}}\n  <div class=\"hidden-search-controls\">\n    <div class=\"hidden-search-controls-content\">\n      <div class=\"hidden-filter-controls-search\">\n        <div class=\"search-query-holder\">\n          <div class=\"search-query\">\n            {{ T \"widgets.list.dynamic.search.searchingFor\"}}\n            <span class=\"current-query-wrapper\"><span class=\"current-query\"></span><span\n                class=\"clear-search focus-outline\"\n                tabindex=\"0\"\n              ><i class=\"fa fa-times\"></i></span></span>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n  {{/if}}\n  <div class=\"active-filters hidden\">\n    <div class=\"hidden-filter-controls-label\">{{ T \"widgets.list.dynamic.filter.applied\"}}</div>\n    <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\n      <div class=\"hidden-filter-controls-filter-wrapper\">\n        <fieldset data-filter-active-group>\n        </fieldset>\n      </div>\n    </div>\n  </div>\n  {{#if filtersEnabled}}\n  <div class=\"hidden-filter-controls\">\n    <div class=\"hidden-filter-controls-content\">\n      {{#unless filtersInOverlay}}\n      {{#if filtersEnabled}}\n      <div class=\"filter-holder inline-filter-holder\">\n        <!-- Filters here -->\n      </div>\n      {{/if}}\n      {{/unless}}\n    </div>\n  </div>\n  {{/if}}\n  <!-- End of Inline Search and Filters -->\n\n  <div class=\"small-card-list-wrapper\" id=\"small-card-list-wrapper-{{id}}\">\n    <!-- List items will appear here -->\n  </div>\n\n  {{#if enabledLimitEntries}}\n  <div class=\"limit-entries-text\">\n    {{#ifCond limitEntries '==' 0}}\n    {{#ifCond searchEnabled '||' filtersEnabled}}\n    <p>\n      {{#if searchEnabled}}{{ T \"widgets.list.dynamic.search.title\"}}{{/if}}\n      {{#ifCond searchEnabled '&&' filtersEnabled}}\n      {{ T \"widgets.list.dynamic.search.andOr\"}}\n      {{/ifCond}}\n      {{#if filtersEnabled}}{{ T \"widgets.list.dynamic.filter.title\"}}{{/if}}\n      {{ T \"widgets.list.dynamic.search.toSeeItems\"}}\n    </p>\n    {{/ifCond}}\n    {{/ifCond}}\n    {{#ifCond limitEntries '>' 0}}\n    <p>\n      {{ T \"widgets.list.dynamic.search.limitItems\" limit=limitEntries}}\n      {{#ifCond searchEnabled '||' filtersEnabled}}\n      {{#if searchEnabled}}\n      {{ T \"widgets.list.dynamic.search.title\"}}{{/if}}\n      {{#ifCond searchEnabled '&&' filtersEnabled}}\n      {{ T \"widgets.list.dynamic.search.andOr\"}}\n      {{/ifCond}}\n      {{#if filtersEnabled}}{{ T \"widgets.list.dynamic.filter.title\"}}{{/if}}\n      {{ T \"widgets.list.dynamic.search.toSeeMore\"}}{{/ifCond}}\n    </p>\n    {{/ifCond}}\n  </div>\n  {{/if}}\n\n  <div class=\"loading-data\">\n    <i class=\"fa fa-circle-o-notch fa-spin\"></i>\n    {{ T \"widgets.list.dynamic.loading\"}}\n  </div>\n  <div class=\"no-results-holder\">\n    {{ T \"widgets.list.dynamic.search.noMatches\"}}\n  </div>\n  <div class=\"no-bookmarks-holder\">\n    {{ T \"widgets.list.dynamic.search.noBookmarked\"}}\n  </div>\n</div>\n\n<!-- Detail view overlay -->\n<div class=\"small-card-detail-overlay\" id=\"small-card-detail-overlay-{{id}}\">\n  <div class=\"small-card-detail-overlay-wrapper\">\n    <div class=\"small-card-detail-overlay-panel\">\n      <div\n        class=\"small-card-detail-overlay-close {{#if previousScreen}}go-previous-screen{{/if}} focus-outline\"\n        tabindex=\"0\"\n      >\n        <img src=\"{{closeIcon.black.url}}\" class=\"close-icon\" alt=\"close icon\" />\n      </div>\n      <div class=\"small-card-detail-overlay-content\">\n        <div class=\"small-card-detail-overlay-content-holder\">\n          <!-- Details will be added here -->\n        </div>\n      </div>\n    </div>\n    <div\n      class=\"small-card-detail-overlay-close tablet {{#if previousScreen}}go-previous-screen{{/if}} focus-outline\"\n      tabindex=\"0\"\n    >\n      <img src=\"{{closeIcon.black.url}}\" class=\"close-icon\" alt=\"close icon\" />\n    </div>\n  </div>\n  <div\n    class=\"small-card-detail-overlay-screen {{#if previousScreen}}go-previous-screen{{/if}}\"\n  ></div>\n</div>\n\n{{#if showAddEntry}}\n<div class=\"dynamic-list-add-item focus-outline\" tabindex=\"1\">\n  <i class=\"fa fa-plus\"></i>\n</div>\n{{/if}}\n";
