this["Fliplet"]["Widget"]["Templates"]["templates.build.small-h-card-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "{{#if [Image]}}\n<div class=\"small-h-card-list-detail-image-wrapper\">\n  <div\n    class=\"small-h-card-list-detail-image\"\n    style=\"background-image: url('{{auth [Image]}}')\"\n  ></div>\n  {{#unless [Image]}}<i class=\"fa fa-user\"></i>{{/unless}}\n</div>\n{{/if}}\n<div class=\"small-h-card-list-detail-content-scroll-wrapper\" data-entry-id=\"{{id}}\">\n  <div class=\"small-h-card-list-detail-content-wrapper\">\n    <div class=\"small-h-card-list-detail-name\">{{[First Name]}} {{[Last Name]}}</div>\n    <div class=\"small-h-card-list-detail-role\">{{[Title]}}</div>\n    <div class=\"small-h-card-list-detail-location\">{{[Location]}}</div>\n    <div class=\"small-h-card-list-detail-buttons-wrapper\">\n      {{#if [Email]}}\n      <div class=\"small-h-card-list-detail-button\">\n        <a href=\"mailto:{{[Email]}}\" target=\"_blank\" class=\"focus-outline\">\n          <div class=\"small-h-card-list-detail-button-image\"><span\n              class=\"fa fa-envelope-o\"\n            ></span></div>\n          <div class=\"small-h-card-list-detail-button-text\">{{T\n            \"widgets.list.dynamic.smallCard.email\" }}</div>\n        </a>\n      </div>\n      {{/if}}\n      {{#if [Telephone]}}\n      <div class=\"small-h-card-list-detail-button\">\n        <a href=\"tel:{{[Telephone]}}\" target=\"_blank\" class=\"focus-outline\">\n          <div class=\"small-h-card-list-detail-button-image\"><span class=\"fa fa-phone\"></span></div>\n          <div class=\"small-h-card-list-detail-button-text\">{{T\n            \"widgets.list.dynamic.smallCard.call\" }}</div>\n        </a>\n      </div>\n      {{/if}}\n      {{#if [Linkedin]}}\n      <div class=\"small-h-card-list-detail-button\">\n        <a href=\"{{[Linkedin]}}\" target=\"_blank\" class=\"focus-outline\">\n          <div class=\"small-h-card-list-detail-button-image\"><span\n              class=\"fa fa-linkedin\"\n            ></span></div>\n          <div class=\"small-h-card-list-detail-button-text\">{{T\n            \"widgets.list.dynamic.smallCard.linkedin\" }}</div>\n        </a>\n      </div>\n      {{/if}}\n    </div>\n\n    <div class=\"small-h-card-details-holder\">\n      {{#each entryDetails}}\n      <!-- Image template -->\n      {{#ifCond type '==' 'image'}}\n      {{#if content}}\n      <div data-detail-entry-id=\"{{id}}\">\n        {{#if labelEnabled}}\n        <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n        {{/if}}\n        {{#if (isSingle contentArray)}}\n        <div class=\"small-h-card-list-detail-body-text single-image-holder\">\n          <img src=\"{{validateImage content}}\" />\n        </div>\n        {{else}}\n        <div class=\"multiple-images-holder\">\n          {{#each contentArray}}\n          <div class=\"multiple-images-item\">\n            <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\n          </div>\n          {{/each}}\n        </div>\n        {{/if}}\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Plain text template -->\n      {{#ifCond type '==' 'text'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">{{content}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- HTML template -->\n      {{#ifCond type '==' 'html'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">{{{auth content}}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- URL template -->\n      {{#ifCond type '==' 'url'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">\n        <a href=\"{{{auth content}}}\" target=\"_blank\">{{ T \"widgets.list.dynamic.detail.linkText\"\n          }}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Telephone template -->\n      {{#ifCond type '==' 'tel'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">\n        <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Email template -->\n      {{#ifCond type '==' 'mail'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">\n        <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\n      </div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Number template -->\n      {{#ifCond type '==' 'number'}}\n      {{#if content includeZero=true}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">{{TN content forceNumber=false}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- Date template -->\n      {{#ifCond type '==' 'date'}}\n      {{#if content}}\n      {{#if labelEnabled}}\n      <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n      {{/if}}\n\n      <div class=\"small-h-card-list-detail-body-text\">{{formatDate content}}</div>\n      {{/if}}\n      {{/ifCond}}\n\n      <!-- File template -->\n      {{#ifCond type '==' 'file'}}\n      {{#if content}}\n      <ul class=\"file-holder\">\n        {{#if labelEnabled}}\n        <div class=\"small-h-card-list-detail-label\">{{label}}</div>\n        {{/if}}\n        {{#each content}}\n        <li class=\"file-item\">\n          <div class=\"file-title\">{{this.name}}</div>\n          <div class=\"file-info\">\n            <span class=\"file-info-uploaded\">{{ T \"widgets.list.dynamic.detail.uploaded\" }}:\n              {{formatDate this.uploaded}}</span>\n            {{#if this.size}}<span class=\"file-info-size\">&ndash;\n              {{humanFileSize this.size}}</span>{{/if}}\n          </div>\n          <input type=\"hidden\" value=\"{{this.url}}\" />\n          <div class=\"file-icon\">\n            <i class=\"fa fa-angle-right\"></i>\n          </div>\n        </li>\n        {{/each}}\n      </ul>\n      {{/if}}\n      {{/ifCond}}\n\n      {{/each}}\n    </div>\n\n    <!-- Edit or Delete buttons -->\n    {{#ifCond editEntry '||' deleteEntry}}\n    <div class=\"dynamic-list-controls\">\n      {{#if editEntry}}\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">{{T\n        \"widgets.list.dynamic.detail.edit\" }}</div>\n      {{/if}}\n      {{#if deleteEntry}}\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">{{T\n        \"widgets.list.dynamic.detail.delete\" }}</div>\n      {{/if}}\n    </div>\n    {{/ifCond}}\n  </div>\n</div>\n";
},"useData":true});

this["Fliplet"]["Widget"]["Templates"]["templates.build.small-h-card-loop"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "{{#each this}}\n  <div class=\"small-h-card-list-item\" data-entry-id=\"{{id}}\">\n    <div class=\"small-h-card-list-image focus-outline\" tabindex=\"0\">\n      <div class=\"small-h-card-list-detail-wrapper\" data-entry-id=\"{{id}}\">\n        <div class=\"small-h-card-list-detail-image-wrapper\">\n          <div class=\"small-h-card-list-detail-image\" style=\"background-image: url('{{auth [Image]}}')\"></div>\n          {{#unless [Image]}}<i class=\"fa fa-user\"></i>{{/unless}}\n        </div>\n      </div>\n    </div>\n    <div class=\"small-h-card-list-item-text\">{{[First Name]}} {{[Last Name]}}</div>\n  </div>\n{{/each}}\n";
},"useData":true});